    G = [[] for _ in range(n)]
    for (u, v) in friendships:
        u += 1
        v -= 1
        G[u].append(v)
        G[v].append(u)
    if n >= 48:
        G = G[:48]
        n = 48

    def ok(a, b, c, d, e):
        allfd = True
        nofd = True
        people = [a, b, c, d, e]
        for x in people:
            for y in people:
                if x == y:
                    continue
                if x in G[y]:
                    nofd = False
                else:
                    allfd = False
        return allfd or nofd
    sz = len(G)
    for a in range(sz):
        for b in range(a + 1, sz):
            for c in range(b + 1, sz):
                for d in range(c + 1, sz):
                    for e in range(d + 1, sz):
                        if ok(a, b, c, d, e):
                            return [a + 1, b + 1, c + 1, d + 1, e + 1]
    return -1

